              {links.map((link, index) => (
                <Draggable draggableId={uuidv4()} index={index}>
                  {(provided) => (
                    <div                       
                      {...provided.draggableProps}
                      {...provided.dragHandleProps}
                      ref={provided.innerRef}
                    > 
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </List>
          </div>
        )}
      </Droppable>
    </DragDropContext>
  );
}

export default Playlist;
